export default function About() {
  return (
    <div className="about-page page-container">
      <h1>ABOUT</h1>
      <p>
        <b>
          <strong>Process</strong>
        </b>{" "}
        I started this project by setting up my folder structure. I do this
        before writing any code because it helps me stay organized and I can
        begin to picture each part of the project and where I want to start
        building. I build out the routes, export and link all page components,
        and build/style a simple navigation bar and footer so that I have a
        standard page template where I can visualize and start to build each
        component, piece by piece.
      </p>
    </div>
  );
}
